import React from 'react'
import Typed from 'react-typed';

function Main() {
  return (
    <div className='text-black'>
        <div className='max-w-[1000px] mt-[-200px] w-full h-screen mx-900 px-3 text-left flex flex-col justify-center color:gray'>
            <div className='flex justify-left items-left'>
            <h1 className='text-black p-1 md:text-5xl sm:text-4xl text-3xl font-semibold px-20 '>Tech Experts for </h1>
            <Typed
                className='md:text-5xl sm:text-4xl text-3xl font-semibold px-20 p-1'
                strings={['IT,', 'SAP,', 'Training.']}
                typeSpeed={120}
                backSpeed={140}
                loop
          />
          </div>

            <p className='md:text-2xl sm:text-xl text-xl py-4 px-20'>
                Welcome to OLIVE Technical Services, the leading provider of comprehensive
                IT & SAP, plant services, and Trainings.
            </p>
            </div>
    </div>
  )
}

export default Main
